const Navbar = () => {
   return ( 
       <nav className="navbar">
           <div className="header">
               <h1>Book Management App</h1>
               <a href="#">Logout</a>
           </div>

           <div className="search">
               <input type="text" placeholder="Search" />
           </div>
       </nav>
    );
}

export default Navbar;
